import "./App.css";

function App() {
  return (
    <div className="App">
      <div>
        <div className="heading">RAILWAY SCHEDULER</div>
        <div className="content">
          <div
            style={{
              display: "flex",
              width: "50%",
              flexDirection: "column",
              border: "1px solid black",
            }}
          >
            <h1>Train Name</h1>
          </div>
          <div
            style={{ display: "flex", width: "20%", flexDirection: "column" }}
          >
            <h1>SC/AC</h1>
          </div>
          <div
            style={{ display: "flex", width: "30%", flexDirection: "column" }}
          >
            <h1>50 seats</h1>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
